import Navbar from "./Components/Navigation/Navbar";
import Input from "./Components/Pages/Input";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <>

<Switch>
        <Route exact path="/">
          <Home/>
        </Route>
        <Route path="/posts">
          <Home/>
        </Route>
</Switch>

    <Navbar/>
    <Input/>
    </>

  );
}

export default App;
